        formData.append('file', this.bulkUpload);
        return formData;
    }
    bulkUploadFun() {
        if (this.bulkUpload == null) {
            this.toastrService.openToast(ToastrTitle.ERROR, BulkUploadEnum.NO_FILE, ToastrColor.ERROR);
            return;
        }
        this.dialogRef.close(this.bulkUpload);
    }
}
